function findBestBet(chance, odd) {
    let i = Math.floor((odd - 1) / .1);
    let k = Math.floor((chance) / .01)
    if (i < 0 || isNaN(i)) i = 0;
    if (i >= BEST_BET_LIST.length) i = BEST_BET_LIST.length - 1;
    if (k < 0 || isNaN(k)) k = 0;
    if (k >= BEST_BET_LIST[i].length) k = BEST_BET_LIST[i].length - 1;

        return .5;
    return BEST_BET_LIST[i][k];
}

